function submitNickname(){let n=document.querySelector("#nicknameInput"),t=document.querySelector("#nicknameErrorLabel");if(t.textContent="",n.value.length<3){t.textContent+="Nickname mus have at least 3 haracters";return}let i=n.value;localStorage.setItem("userNickname",JSON.stringify(i));console.log("Nickname submitted: "+i);window.location.href="/home/lobby/"}function submitCreateRoom(){let n=document.querySelector("#roomNameInput"),i=document.querySelector("#roomPasswordInput"),t=document.querySelector("#roomNameErrorLabel");if(t.textContent="",n.value.length<1)t.textContent+="Room name cannot be blank";else{let t=i.value||"";createNewRoom(n.value,t)}}function togglePopUp(n){let t=document.querySelector(n);t.style.display=t.style.display=="none"?"block":"none"}function checkIfNicknameSet(){let n=JSON.parse(localStorage.getItem("userNickname"));n||(window.location.href="/home/index/")}function createNewRoom(n,t){let r=JSON.parse(localStorage.getItem("userNickname"));r||(window.location.href="/home/index/");let u={roomName:n,playername:r,password:t};var i={};i.url="/api/room/CreateRoom";i.type="POST";i.contentType="application/json";i.data=JSON.stringify(u);i.dataType="json";i.success=function(n){console.log("Room succesfully created!",n)};i.error=function(){console.log("Server error")};$.ajax(i);updateRoomList("#result")}function updateRoomList(n){let i=document.querySelector(n);for(console.log("divToPassList: ",n);i.firstChild;)i.removeChild(i.firstChild);var t={};t.url="/api/room/GetRoomList";t.type="GET";t.dataType="json";t.success=function(t){t.forEach(function(t){console.log(t);let i="<div class='roomInfo'><div class='roomName'>"+t.roomName+"<\/div><div class='playerName'>"+t.ownerName+"<\/div>";i+=t.requirePassword?"<i class='fas fa-lock'><\/i><\/div>":"<div><\/div><\/div>";$(n).append(i)})};t.error=function(){$("#msg").html("Error while calling the Web API!")};$.ajax(t)}